import User from "./User"
import { useState, useEffect } from "react"

const Users =()=> {

    const [ users, setUsers ] = useState([])

    useEffect(()=> {
        axios.get('http://localhost:3005/api/user')
            .then(res => {
                setUsers(res.data)
            })
    }, [])

    const userComponents = users.map(users => {
        return <User 
                    key={users.users_id}
                    lastName={users.lName}
                    firstName={users.fName}
                    username={users.username}
                    email={users.email}
                    dateCreated={users.date_created}
                />
    })

    return(
        <main className="main" id="usersMain">
            <div className="container mt-5 users-con">
                <h2 className="display-3 text-capitalize user-h2">users</h2>
                <div className="row">
                    { userComponents }
                </div>
            </div>
        </main>
    )
}

export default Users
